$(document).keypress(function(n){if(13==n.which){n.preventDefault();var a=$("#search").val();(function(){return $.ajax({url:"https://en.wikipedia.org/w/api.php?action=opensearch&search=&search="+a+"&limit=10&namespace=0&format=json",dataType:"jsonp"})})().done(function(n){var a=$("#contents");a.html(""),a.append("<span>");for(var t=0;t<10;t++){if(void 0===n[3][t])return;a.append("<div class='content'><a href='"+n[3][t]+"' target='_blank' class='linkToContent'><button class='link'><h3 class='title'>"+n[1][t]+"</h3><p class='description'>"+n[2][t]+"</p></h3></button></a></div></span>")}})}});